import Header from './components/Header';
import VolumeForm from './components/VolumeForm';
import ResultCard from './components/ResultCard';
import './index.css';

function App() {
  return (
    <div className="min-h-screen bg-gray-900 text-white flex flex-col items-center p-6 relative">
      <Header />
      <img src="/assets/images/image (1).png" alt="Decorative" className="absolute top-0 left-0 w-40 opacity-25" />
      <img src="/assets/images/image (2).png" alt="Decorative" className="absolute bottom-0 right-0 w-40 opacity-25" />
      <main className="w-full max-w-3xl mt-8 bg-gray-800 p-8 rounded-xl shadow-2xl">
        <VolumeForm />
        <ResultCard />
      </main>
    </div>
  );
}
